import React from "react";

const Restauraunt = props => {
  console.log(props.data.results);
  // const newResults = Array.from(props.results);
  const restaruants = props.data.results.map(result => (
    <section key={result.id} className="rest__card">
      <div className="rest__card-img">
        <img alt="my img" />
      </div>
      <div className="rest__card-info">
        <div className="flex__items-column">
          <div className="rest__card-type"></div>
          <div className="rest__card-name">{result.name}</div>
          <div className="rest__card-address">{result.vicinity}</div>
          <div className="ratings__reviews flex__items-row">
            <div className="rest__card-starrating"></div>
            <div className="rest__card-reviewstotal"></div>
          </div>
          <div className="b_times rest__card-footer flex__items-row">
            <div className="rest__card-footer-inner">
              <div className="rest__card-opentimes"></div>
              <div className="rest__card-close"></div>
            </div>
          </div>
        </div>
      </div>
    </section>
  ));
  // console.log(newResults);
  return <div>{restaruants}</div>;
};

export default Restauraunt;
